import React from "react";
import PropTypes from "prop-types";

import ListCard from "../common/ListCard";

export default function ProfileContent({ profile }) {
  return (
    <div>
      <div className="fixed-action-btn">
        <a
          href="#"
          className="hoverable waves-effect btn-floating btn-large red"
        >
          <i className="large material-icons">mode_edit</i>
        </a>
      </div>
      <img src={profile.avatar} alt="profile avatar" className="profile-img" />
      <h4>{profile.user.name}</h4>
      <div className="cards">
        <ListCard title="Languages Spoken" list={profile.languages} />
        <ListCard title="Interested in Languages" list={profile.interestedIn} />
        <ListCard title="Hobbies" list={profile.hobbies} />
      </div>
    </div>
  );
}
